function getMenuCurso(pos) {   
    $("#main-content-iframe").attr("src", "CommonCursoGetMenu?key=" + $("#keyDummy").val() + "&pos=" + pos);
}

function getMenuCursoProf(a) {
    $("#main-content-iframe").attr("src", "CommonCursoGetMenu?key=" + $("#keyProfDummy").val() + "&pos=" + a);
}

function executeMenuCursoAction(a) {
    var b = {key: $("#keyDummy").val()};
    jQuery.ajax({
        url: a, 
        type: "POST", 
        data: b, 
        success: function (a)
        {
            $("#menu-inner-iframe").attr("srcdoc", a);
        }, async: !1
    });
}

function executeAction(a) {   
    $("#main-content-iframe").attr("src", a + "?key=" + $("#keyDummy").val());
}

function executeActionParm(a) {
    $("#main-content-iframe").attr("src", a + "&key=" + $("#keyDummy").val());
}

function misCursosProfAction(a, b) {
    $("#main-content-iframe").attr("src", "CommonMisCursos?key=" + $("#keyProfDummy").val() + "&actionCall=" + b + "&title=" + a.toString().toUpperCase());
}

function executeProfAction(a) {
    $("#main-content-iframe").attr("src", a + "?key=" + $("#keyProfDummy").val());
}

function executeActionNested(a) {
    $("#main-content-iframe").attr("src", a);
}

function executeSimpleAction(a) {
    $("#main-content-iframe").attr("src", a);
}

function executeActionMessage() {
    $("#main-content-iframe").attr("src", "CommonMensajeEnableConsola?key=" + $("#keyDummy").val() + "&action=R");
}

function getMessages() {
    var a = {key: $("#keyDummy").val()};
    jQuery.ajax({
        url: "CommonMensajeGetNumMessages",
        type: "POST",
        data: a,
        success: function (a) {
            $("#mensajes-li").html(a);
        },
        async: !1});
}

function showAlertMessages() {
    getMessages();
    setInterval("getMessages()", 12E4);
}